const doctorsContainer = document.getElementById('doctorsContainer');
const specialtyBtns = document.querySelectorAll('.specialty-btn');
const modal = document.getElementById('doctorModal');
const closeModal = document.querySelector('.close-modal');

function renderDoctors(specialty = 'all') {
    doctorsContainer.innerHTML = '';
    
    const filteredDoctors = specialty === 'all' 
        ? doctors 
        : doctors.filter(doctor => doctor.specialty === specialty);
    
    if (filteredDoctors.length === 0) {
        doctorsContainer.innerHTML = '<p>No doctors found for this specialty.</p>';
        return;
    }
    
    filteredDoctors.forEach(doctor => {
        const doctorCard = document.createElement('div');
        doctorCard.className = 'doctor-card';
        doctorCard.setAttribute('data-doctor-id', doctor.id);
        
        doctorCard.innerHTML = `
            <div class="doctor-image" style="background-image: url('${doctor.image}')"></div>
            <div class="doctor-info">
                <h3 class="doctor-name">${doctor.name}</h3>
                <p class="doctor-specialty">${doctor.specialty}</p>
                <p class="doctor-experience">${doctor.experience}</p>
                <p class="doctor-hospital">${doctor.hospital}</p>
                <a class="view-profile">View Profile & Book</a>
            </div>
        `;
        
        doctorsContainer.appendChild(doctorCard);
        
        doctorCard.addEventListener('click', () => openDoctorModal(doctor.id));
    });
}

function openDoctorModal(doctorId) {
    const doctor = doctors.find(d => d.id === doctorId);
    
    if (doctor) {
        document.getElementById('modalDoctorName').textContent = doctor.name;
        document.getElementById('modalDoctorSpecialty').textContent = doctor.specialty;
        document.getElementById('modalDoctorExperience').textContent = doctor.experience;
        document.getElementById('modalDoctorHospital').textContent = doctor.hospital;
        document.getElementById('modalDoctorEducation').textContent = doctor.education;
        document.getElementById('consultationFee').textContent = `Consultation Fee: ${doctor.fee}`;
        document.getElementById('modalDoctorImage').style.backgroundImage = `url('${doctor.image}')`;
        
        modal.classList.add('active');
    }
}

document.addEventListener('DOMContentLoaded', function() {
    renderDoctors();
    
    specialtyBtns.forEach(btn => {
        btn.addEventListener('click', function() {
            specialtyBtns.forEach(b => b.classList.remove('active'));
            this.classList.add('active');
            const specialty = this.getAttribute('data-specialty');
            renderDoctors(specialty);
        });
    });
    
    closeModal.addEventListener('click', function() {
        modal.classList.remove('active');
    });
    
    modal.addEventListener('click', function(e) {
        if (e.target === modal) {
            modal.classList.remove('active');
        }
    });
    
    const dateTabs = document.querySelectorAll('.date-tab');
    dateTabs.forEach(tab => {
        tab.addEventListener('click', function() {
            dateTabs.forEach(t => t.classList.remove('active'));
            this.classList.add('active');
        });
    });
    
    const timeSlots = document.querySelectorAll('.time-slot:not(.booked)');
    timeSlots.forEach(slot => {
        slot.addEventListener('click', function() {
            if (!this.classList.contains('booked')) {
                document.querySelectorAll('.time-slot.selected').forEach(s => s.classList.remove('selected'));
                this.classList.add('selected');
            }
        });
    });
});